import Vue from 'vue'
import App from './App.vue'
import vueRouter from 'vue-router'
Vue.use(vueRouter)
import home from './views/home.vue'
import my from './views/my.vue'
const router = new vueRouter({
  routes: [
    {path: '/', component: home},
    {path: '/my', component: my}
  ]
})



Vue.config.productionTip = false

new Vue({
  router,
  render: h => h(App),
}).$mount('#app')
